import React, {useState} from "react";

import '../stylesheets/Icons.css'
import '../stylesheets/Form&Input&Select.css'

/**
 * @author Sven
 * @version 06/08/2021
 * When address is found from RegisterChargerMapPage.js, it redirects to this page
 * @component
 */
const RegisterChargerPage = (props) => {

    const [chargerType, setChargerType] = useState(null);
    const [chargerStatus, setChargerStatus] = useState(null);

    return (
        <div className="formBox">
            <h3>Registrer en lader</h3>
            <form className="form" onSubmit={() => console.log("Yo")}>
                <div className="inputContainer">
                    <input onBlur={() => {
                        setChargerStatus("loading");
                    }} type="text" placeholder="Addresse"/>
                    {chargerStatus != null ?
                        <span className={chargerStatus} style={{height: "16px", width: "16px",
                            transform: "translate(-100%)"}}/> : null}

                </div>
                <div className="inputContainer">
                    <select onChange={(e) =>
                        setChargerType(e.target.value)} name="chargerType">
                        <option value="" disabled selected>Lader type</option>
                        <option value="easee">
                            Easee
                        </option>
                        <option value="zaptec">
                            Zaptec
                        </option>
                    </select>
                </div>
                <input type="text" placeholder="Laderens id"/>
                {chargerType == "zaptec" ?
                    <input type="text" placeholder="Zaptec brukernavn"/> : null}
                {chargerType == "zaptec" ?
                    <input type="password" placeholder="Zaptec password"/> : null}
                <button className="button" type="submit">Registrer laderen</button>
            </form>
        </div>
    )
}

export default RegisterChargerPage;
